    var global_array = [
        {
            get first() {
                for(var i=0; i<100; i++) {
                    global_array.pop();
                }
            }
        }
    ];

    // build a 200 elements array
    for(var i=0; i < 200; i++)
        global_array.push(0x41);

    // when the first item will be accessed, it should remove 100 items.

    global_array;
            """
